export enum CustomTextureTypes { FloorColorGuide, FloorGoalTile, FloorAirHoles, FloorFanTile_0, FloorFanTile_1, FloorFanTile_2, FloorFanTile_3, FloorFanTile_4, FloorFanTile_5, FloorFanTile_6, FloorFanTile_Simple_0, FloorFanTile_Simple_1, FloorFanTile_Simple_2, FenceTile, FenceTop, PuckArrow_Down, PuckArrow_Forward, PuckArrow_Up };

export class TextureData
{
	public readonly width: number;
	public readonly height: number;
	public readonly colors: Uint8Array;

	constructor(_width: number, _height: number, _colors: Uint8Array)
	{
		this.width = _width;
		this.height = _height;
		this.colors = _colors;
	}

	public static fromPaletteGrid(_width: number, _height: number, _palette: number[][], _colorGrid: number[]) : TextureData
	{
		let colors = new Uint8Array(_width * _height * 3);
		for (let i = 0; i < _colorGrid.length; i++)
		{
			for (let j = 0; j < 3; j++)
				colors[i * 3 + j] = _palette[_colorGrid[i]][j];
		}
		return new TextureData(_width, _height, colors);
	}

	public static fromPaletteCursor(_width: number, _height: number, _palette: number[][], _cursorColors: number[]) : TextureData
	{
		let colors = new Uint8Array(_width * _height * 3);
		let cursorColor: number[];
		let cursorIndex: number = 0;
		for (let i = 0; i < _cursorColors.length; i += 2)
		{
			cursorColor = _palette[_cursorColors[i]];
			let colorLength = _cursorColors[i + 1];
			while (colorLength > 0)
			{
				for (let j = 0; j < 3; j++)
					colors[cursorIndex * 3 + j] = cursorColor[j];
				cursorIndex++;
				colorLength--;
			}
		}
		if (cursorIndex != _width * _height)
			console.log("Final Index Of Cursor Does Not Match Texture Pixel Count!\nFinal Cursor Index: " + cursorIndex.toString() + "\nTexture Pixel Count: " + (_width * _height).toString());
		return new TextureData(_width, _height, colors);
	}
}

export function getTextureData(_textureType: CustomTextureTypes) : TextureData
{
	switch (_textureType)
	{
		case CustomTextureTypes.FloorColorGuide:
			return getFloorColorGuideTextureData();
		case CustomTextureTypes.FloorGoalTile:
			return getFloorGoalTileTextureData();
		case CustomTextureTypes.FloorAirHoles:
			return getFloorAirHoleTileTextureData();
		case CustomTextureTypes.FloorFanTile_0:
		case CustomTextureTypes.FloorFanTile_1:
		case CustomTextureTypes.FloorFanTile_2:
		case CustomTextureTypes.FloorFanTile_3:
		case CustomTextureTypes.FloorFanTile_4:
		case CustomTextureTypes.FloorFanTile_5:
		case CustomTextureTypes.FloorFanTile_6:
		case CustomTextureTypes.FloorFanTile_Simple_0:
		case CustomTextureTypes.FloorFanTile_Simple_1:
		case CustomTextureTypes.FloorFanTile_Simple_2:
			return getFloorFanTileTextureData(_textureType);
		case CustomTextureTypes.FenceTile:
			return getFenceTileTextureData();
		case CustomTextureTypes.FenceTop:
			return getFenceTopTextureData();
		case CustomTextureTypes.PuckArrow_Down:
		case CustomTextureTypes.PuckArrow_Forward:
		case CustomTextureTypes.PuckArrow_Up:
			return getPuckArrowTextureData(_textureType);
	}
	return getUnassignedTextureData();
}

